import house from "./househelp1.png";
import logo from "./house.png"

function Header() {


    return (
      <div className="Header">







       <div id="header" style={{width: "100%", height:"auto", textAlign: "center", backgroundColor: "lightgreen", borderBottom:"2px solid green"}}> 
       <img src={logo} style={{width: "40%" , Height: "50%", marginLeft: "auto", marginRight: "auto"}}></img>
        </div>

        <div style={{width: "250px", height: "auto", marginLeft: "auto", marginRight: "auto", marginTop: "14px"}}>
                <img src={house} width="100%" height="auto" ></img>
            </div>










      </div>
    );
  }

  export default Header;
